import React from 'react';
import { FaShoppingCart, FaSearch, FaFacebookF, FaTwitter, FaInstagram, FaLinkedinIn, FaMapMarker, FaArrowRight } from 'react-icons/fa';

const Home = () => {
  return (
    <div className="relative">
      {/* Top bar */}
      <div className="bg-red-600 text-white py-2 text-sm flex items-center px-8">
        {/* Left (empty div to keep "Free Delivery" centered) */}
        <div className="flex-grow"></div>

        {/* Center: Free Delivery notice */}
        <div className="text-center">
          Free Delivery on all orders Over $50
        </div>

        {/* Right side: Location and Social Media Icons */}
        <div className="flex-grow flex justify-end space-x-4 items-center">
          {/* Location */}
          <span className="flex items-center space-x-1">
            <FaMapMarker />
            <span>Rd. Allentown, New Mexico 31134</span>
          </span>

          {/* Social Media Icons */}
          <div className="flex space-x-2">
            <FaFacebookF className="hover:text-gray-200 cursor-pointer" />
            <FaTwitter className="hover:text-gray-200 cursor-pointer" />
            <FaInstagram className="hover:text-gray-200 cursor-pointer" />
            <FaLinkedinIn className="hover:text-gray-200 cursor-pointer" />
          </div>
        </div>
      </div>

      {/* Navbar */}
      
      <nav className="relative bg-[#010f1c] flex items-center justify-between px-8 py-4 text-white">
        <div className="flex items-center">
          {/* Logo */}
          <div className="text-3xl font-bold">PIZZAN</div>
        </div>
        <ul className="flex space-x-8 text-lg font-medium">
          <li><a href="#home" className="hover:text-red-600">Home</a></li>
          <li><a href="#menu" className="hover:text-red-600">Menu</a></li>
          <li><a href="#shop" className="hover:text-red-600">Shop</a></li>
          <li><a href="#pages" className="hover:text-red-600">Pages</a></li>
          <li><a href="#news" className="hover:text-red-600">News</a></li>
          <li><a href="#contact" className="hover:text-red-600">Contact Us</a></li>
        </ul>
        <div className="flex items-center space-x-6">
          <FaSearch className="text-2xl cursor-pointer hover:text-yellow-500" />
          <FaShoppingCart className="text-2xl cursor-pointer hover:text-yellow-500" />
          <button className="bg-red-600 flex items-center justify-center space-x-2 text-white px-4 py-2 rounded-sm font-semibold hover:bg-red-700">
  <span>BOOK A TABLE</span>
  <FaArrowRight />
</button>

        </div>
      </nav>

      {/* Main section */}
      <div className="relative bg-cover bg-center bg-[url('https://example.com/pizza-bg.jpg')] h-screen flex items-center">
        {/* Overlay */}
        <div className="absolute inset-0 bg-black bg-opacity-50"></div>

        {/* Text content */}
        <div className="relative z-10 px-8 text-white max-w-lg">
          <h1 className="text-5xl font-bold mb-4">GET BEST QUALITY FOOD FROM US</h1>
          <button className="bg-red-600 text-white px-6 py-3 rounded-md font-semibold hover:bg-red-700">
            EXPLORE MENU
          </button>
        </div>

        {/* Floating Food Illustration */}
        <div className="relative z-10 ml-auto">
          {/* Add your food illustration image or element here */}
          <img src="https://example.com/food-illustration.png" alt="Pizza Illustration" className="h-96" />
        </div>
      </div>
    </div>
  );
};

export default Home;
